let arr=[
    {
        "proName":"Annakili",
        "proId":1,
        "proLoc":"Valapady"
    },
    {
    "proName":"Aarthi",
    "proId":2,
    "proLoc":"salem"
},

{
    "proName":"Manoj",
    "proId":3

}]

export const list=()=>{
    return arr;

}

export const add=(ob)=>
{
    arr.push(ob)
}
